import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import FaceDetectionTest from './FaceDetectionTest';

// Render FaceDetectionTest for now to test face detection functionality
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <FaceDetectionTest />
  </React.StrictMode>
);

// To switch back to the main app, comment the above code and uncomment this:
/*
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
*/
